import "../Style/monitor.css"
import Screen1 from '../Images/Monitor/Monitor.svg';
import { Parallax } from 'react-scroll-parallax';

function ScreeOne() {
    return (
        <Parallax speed={50}>
            <img id="screen1" src={Screen1} alt="screen1" />
        </Parallax>
    );
}

export default ScreeOne;
